import React, {Component} from 'react';

class ListUser extends Component {
    render(){
        return(
            <Container className="mt-5 pl-0" style={{minHeight: '600px'}}>
                <Col>
                    <div>
                        <h2>List User</h2>
                    </div>
                </Col>
            </Container>
        )
    }
}

export default ListUser;
